import { Lightbulb, Cpu } from "lucide-react";
import SubjectPage from "./SubjectPage";

const ComputerFundamentals = () => {
  const topics = [
    { name: "Number Systems", desc: "Binary, Octal, Decimal, and Hexadecimal.", icon: <Lightbulb className="w-10 h-10 text-teal-600"/>, path: "/placement-prep/core-subjects/fundamentals/number-systems", color: "from-teal-100 to-teal-50" },
    { name: "Logic Gates & Architecture", desc: "Basic logic gates and computer architecture concepts.", icon: <Cpu className="w-10 h-10 text-blue-600"/>, path: "/placement-prep/core-subjects/fundamentals/architecture", color: "from-blue-100 to-blue-50" },
  ];

  return (
    <SubjectPage
      title="Computer Fundamentals Preparation"
      description="Revise basics: number systems, logic gates, and computer architecture."
      topics={topics}
    />
  );
};

export default ComputerFundamentals;
